import React from "react";
import {Link} from 'react-router-dom';
import 'bootstrap-icons/font/bootstrap-icons.css';

const Navbar = ({toggle}) => {
  return (
    <nav
      className="navbar navbar-expand-lg navbar-light   d-flex justify-content-between px-2"
      style={{ backgroundColor: "#ececf1" }}
    >
      <div className="container-fluid">
        {/* <Link> href="/" className="navbar-brand">
            <img src="../MM Logo1 (2) qr.png" height="28" alt="CoolBrand"/>
        </a> */}

        <div onClick={toggle}>
       <span>          <i className="bi bi-list h-100"></i>
</span> 

          {/* Dashboard */}
        </div>

        <div className="collapse navbar-collapse" id="navbarCollapse">
          <div className="navbar-nav ms-auto border rounded-2">

           <span>            <i className="bi bi-person-circle h-100"></i>
</span> 

          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
